import React from "react";
import CalendarHeatmap from "react-calendar-heatmap";
import data from "./data/StreamingHistoryDesi.json";

const PlainCalendarHeatmap = () => {
    const data = require("./data/StreamingHistoryDesi.json");
    const rawData = data.map(function (elem) {
        let entry = {}
        entry.date = elem.endTime.split(" ")[0];
        entry.msPlayed = elem.msPlayed / 1000;
        return entry;
    });

    let filteredData = Object.values(groupBy(rawData, "date"));

    const streamingData = filteredData.map(function (day) {
        let date = day[0]["date"];
        day = day.reduce(function (prev, cur) {
            prev["totalTracks"] = prev["totalTracks"] + 1;
            prev["count"] = prev["count"] + cur["msPlayed"];
            return prev;
        }, {"totalTracks": 0, "count": 0, "details": [], "summary": [{"name": "test"}]});
        day.date = date;
        return day;
    });

    return(
        <CalendarHeatmap values={streamingData}
        >
        </CalendarHeatmap>
    )

}
export default PlainCalendarHeatmap;
